sources.css\\main.scss:
    $bleu: #09021e;
    $cyan: #4cc9f0;
    $magenta: #f72585;

    * {
        box-sizing: border-box;
        cursor: none !important;
        user-select: none;
    }

    body {
        margin: 0;
        padding: 0;
        width: 100%;
        background: $bleu;
        overflow: hidden !important;
        height: 100vh;
    }

    .progress {
        position: absolute;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
        font-family: 'littleTitle' !important;
        color: $cyan;
        font-size: 12px;
        letter-spacing: 1px;
        transition: 1.5s ease-in-out;

        @media screen and (max-width: 539px) {
            font-size: 2.6vw;
            letter-spacing: .2vw;
        }

        &.switch {
            opacity: 0;
        }
    }

    .containerArrowIndication {
        position: absolute;
        left: 50%;
        bottom: -1.5%;
        transform: translate(-50%, -50%);
        z-index: 10;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        opacity: 0;
        transition: opacity .75s cubic-bezier(.25, 0, 0, 1);

        &.switch {
            opacity: 1;
        }

        .arrow {
            width: 25px;
            height: 25px;
            border-bottom: 1px solid $cyan;
            border-left: 1px solid $cyan;
            transform: rotate(-45deg);
            margin: 5px 0 5px 0;
            opacity: 0;
            animation: blinkTitle 8s infinite ease-in-out alternate;

            @media screen and (max-width: 1024px) {
                width: 20px;
                height: 20px;
            }

            @media screen and (max-width: 539px) {
                width: 15px;
                height: 15px;
                margin: 2px 0 2px 0;
            }
        }
    }


    .containerAlertDiscord {
        position: absolute;
        right: 18px;
        width: 300px;
        height: fit-content;
        background: $bleu;
        top: 70px;
        z-index: 10;
        border: 1px solid $cyan;
        clip-path: inset(0% 0% 0% 100%);

        h3 {
            font-family: "littleTitle";
            font-size: 15px;
            letter-spacing: 1px;
            color: $cyan;
            margin: 10px 3px 10px 3px;
            text-align: center;
            font-weight: normal;
            opacity: 0;
        }
    }

    .containerAlertIut {
        position: absolute;
        left: 18px;
        width: 300px;
        height: fit-content;
        background: $bleu;
        top: 70px;
        z-index: 10;
        border: 1px solid $cyan;
        clip-path: inset(0% 100% 0% 0%);

        h3 {
            font-family: "littleTitle";
            font-size: 15px;
            letter-spacing: 1px;
            color: $cyan;
            margin: 10px;
            text-align: center;
            font-weight: normal;
            opacity: 0;
        }
    }

    .indicGoDesktop {
        display: none;


        @media screen and (max-width: 1024px) {
            position: absolute;
            top: 90%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-family: 'littleTitle';
            color: $cyan;
            z-index: 3;
            display: block;
            text-align: center;
            width: 80%;
            font-size: 12px;
            letter-spacing: 1px;
            opacity: 0;
            transition: .75s cubic-bezier(.25, 0, 0, 1);

            @media screen and (max-width: 539px) {
                font-size: 2.8vw;
                letter-spacing: .2vw;
            }

            &.switch {
                opacity: 1;
            }

        }
    }

    .homeMask {
        position: absolute;
        left: 0;
        top: 0;
        background: rgba(9, 2, 30, 0.4);
        z-index: 2;
        width: 100%;
        height: 100vh;
        opacity: 0;
        overflow: hidden !important;
    }

    canvas {
        display: block;
        position: absolute;
        height: 100vh;
        width: 100%;
        z-index: 1;
        opacity: 1;
        top: 0;
        left: 0;

        &.hologramActive {
            transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
            animation: blinkCanvas 6s infinite;
        }

        &.hologramDefault {
            transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
            animation: none;
        }

        @keyframes blinkCanvas {
            30% {
                opacity: 1;
            }

            32% {
                opacity: .7;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .7;
            }

            40% {
                opacity: 1;
            }

            80% {
                opacity: .7;
            }

            82% {
                opacity: 1;
            }

            85% {
                opacity: .7;
            }

            87% {
                opacity: 1;
            }
        }
    }

    .switchPointer {
        pointer-events: all !important;
    }

    ////CURSOR CUSTOM///
    @media screen and (max-width: 1024px) {
        .cursor {
            display: none;
        }

        .cursor-shape_out {
            display: none;
        }

        .cursor-shape_out.mouseover {
            display: none;
        }
    }

    .cursor {
        position: fixed;
        pointer-events: none;
        z-index: 100;
        mix-blend-mode: difference;
        opacity: 0;
    }

    .cursorSize {
        position: absolute;
        pointer-events: none;
        width: 20px;
        height: 20px;
        padding: 0;
        left: 0;
        top: 0;
        border-radius: 50px;
    }

    .cursor-shape_in {
        position: absolute;
        pointer-events: none;
        border-radius: 50px;
        left: 0;
        top: 0;
        width: 20px;
        height: 20px;
        background: $cyan;
        transition: opacity .75s cubic-bezier(.25, 0, 0, 1);

        &.mouseover {
            transition: opacity .5s cubic-bezier(.25, 0, 0, 1);
            opacity: 0;
        }
    }

    .cursor-shape_out {
        opacity: 0;
        mix-blend-mode: difference;
        z-index: 99;
        position: absolute;
        pointer-events: none;
        border-radius: 50px;
        left: 0;
        top: 0;
        width: 50px;
        height: 50px;
        border: $cyan solid 1px;
        transition: padding .75s cubic-bezier(.25, 0, 0, 1);
    }

    .indicMouseHover {
        opacity: 0;
        z-index: 100;
        position: absolute;
        top: 50%;
        left: 50%;
        color: $cyan;
        pointer-events: none;
        font-family: littleTitle;
        font-size: 10px;
        font-weight: bold;
        letter-spacing: 1.5px;
        transition: opacity .1s cubic-bezier(.75, 0, 0, 1);

        &.planeHover {
            transition: opacity .75s cubic-bezier(.75, 0, 0, 1);
            opacity: 1;
        }

        @media screen and (max-width: 1024px) {
            display: none;
        }
    }


    .indicClickOnPlane {
        transform: translate(-37%, 20%);
    }

    ////MAIN///
    .workShopContainer {
        width: 100%;
        height: 100vh;
        position: fixed;
        z-index: 2;
        opacity: 0;
        pointer-events: none;
        display: flex;
        justify-content: center;
        align-items: center;

        &.switchPlane {
            pointer-events: all;
        }

        .contentContainer {
            display: none;
            width: 100%;
            height: 100vh;
            background: rgba(9, 2, 30, 0.6);
            overflow: auto !important;
            -ms-overflow-style: none;
            scrollbar-width: none;

            &::-webkit-scrollbar {
                display: none;
            }

            .title {

                text-align: center;
                font-family: "main";
                font-size: 5vw;
                letter-spacing: .15vw;
                margin: 43vh auto 25vh auto;
                color: $cyan;
                text-transform: uppercase;
                width: fit-content;
                opacity: 1 !important;

                @media screen and (max-width: 539px) {
                    font-size: 7.5vw;
                    letter-spacing: .25vw;
                    margin: 43vh auto 0 auto;
                }
            }


            iframe,
            .contenu {
                width: 640px;
                height: 360px;
                display: flex;
                margin: 2vh 1vh 22vh 0;
                border: none;



                &__link {
                    transition: .75s ease;
                    color: $cyan;
                    text-decoration: none;
                    position: relative;

                    @media screen and (min-width: 1025px) {
                        &::after {
                            content: " ";
                            position: absolute;
                            left: 0;
                            bottom: 29%;
                            width: 100%;
                            height: 1px;
                            background: $cyan;
                            clip-path: inset(0 50% 0 50%);
                            transition: .5s cubic-bezier(.25, 0, 0, 1);
                        }

                        &:hover::after {
                            clip-path: inset(0 0 0 0);
                        }

                    }
                }

            }


            .containerPara__1 {
                width: 100%;
                display: flex;
                justify-content: flex-end;
                align-items: center;

                @media screen and (max-width: 1024px) {
                    margin: 110% 0 40% 0;
                }

                .para {
                    width: 25%;
                    margin: 22vh 22vw 22vh 0;
                    display: flex;
                    flex-direction: column;
                    align-items: flex-end;

                    @media screen and (max-width: 1024px) {
                        margin: 5% !important;
                        width: 65% !important;
                    }

                    @media screen and (max-width: 539px) {
                        width: 90% !important;
                    }

                    .subtitle {
                        font-family: "littleTitle";
                        font-size: 25px;
                        color: $magenta;
                        margin: 0;

                        @media screen and (max-width: 539px) {
                            font-size: 5.2vw;
                        }
