    @keyframes titleIn {
        0% {
            stroke-dashoffset: -1000;
        }

        40% {
            stroke-dashoffset: 0;
            fill: transparent;
        }

        45% {
            fill: $cyan;
        }

        70% {
            fill: $cyan;
        }

        100% {
            fill: $cyan;
            stroke-dashoffset: 0;
        }
    }

    @keyframes titleOut {
        0% {
            stroke-dashoffset: 0;
            fill: $cyan;
        }

        10% {
            fill: transparent;
        }

        80% {
            stroke-dashoffset: -1000;
            fill: transparent;
        }

        85% {
            fill: transparent;
        }

        100% {
            fill: transparent;
            stroke-dashoffset: -1000;
        }
    }

    @keyframes lineIn {
        0% {
            stroke-dashoffset: -1000;
            stroke-width: 0.5px;
        }

        40% {
            stroke-dashoffset: 0;
            fill: transparent;
            stroke-width: 0.5px;
        }

        45% {
            fill: transparent;
            stroke-width: 0.5px;
        }

        70% {
            stroke-width: 4px;
            stroke-dashoffset: 0;
        }

        100% {
            stroke-width: 4px;
            stroke-dashoffset: 0;
        }
    }

    @keyframes lineOut {
        0% {
            stroke-dashoffset: 0;
            stroke-width: 4px;
        }

        10% {
            stroke-width: 0.5px;
        }

        80% {
            stroke-dashoffset: -1000;
            stroke-width: 0.5px;
        }

        85% {
            stroke-width: 0.5px;
        }

        100% {
            stroke-width: 0.5px;
            stroke-dashoffset: -1000;
        }
    }

