            background: #4ccaf027;

            @keyframes mouse {
                0% {
                    background: #4ccaf027;
                    opacity: 1;
                    transform: translateX(-13px);
                }

                20% {
                    background: #4ccaf000;
                }

                40% {
                    background: #4ccaf027;
                }

                46% {
                    opacity: 1;
                    transform: translateX(-13px);
                }

                54% {
                    opacity: 0;
                    transform: translateX(-53px);
                }

                60% {
                    background: #4ccaf000;
                }

                80% {
                    background: #4ccaf027;
                }

                100% {
                    background: #4ccaf000;
                    opacity: 0;
                    transform: translateX(-53px);
                }
            }

            .containerPointMouse {
                display: flex;
                justify-content: center;
                align-items: center;
                flex-direction: column;
                margin-bottom: 12px;

                .blockMouse {
                    width: 2px;
                    height: 2px;
                    background: $cyan;
                    margin: 1px 0 1px 0;
                    opacity: 0;
                    transform: scale(0);
                    animation: pointMouse .75s cubic-bezier(.75, 0, 0, 1) infinite alternate;

                    &:nth-child(1) {
                        animation-delay: 0s;
                    }

                    &:nth-child(2) {
                        animation-delay: .1s;
                    }

                    &:nth-child(3) {
                        animation-delay: .2s;
                    }

                    @keyframes pointMouse {
                        0% {
                            opacity: 0;
                            transform: scale(0);
                        }

                        100% {
                            opacity: 1;
                            transform: scale(1);
                        }
                    }
                }

            }

        }

        .textIndication {
            display: flex;
            justify-content: center;
            align-items: center;

            .indic {
                font-family: 'littleTitle';
                letter-spacing: 2px;
                font-size: 13px;
                font-weight: 600;
                color: $cyan;
            }

            .indicContainer {
                font-family: 'littleTitle';
                letter-spacing: 2px;
                font-size: 13px;
                font-weight: 600;
                color: $cyan;
                display: flex;
                flex-direction: column;
                justify-content: center;
                position: relative;
                width: 120px;
                height: 20px;
                overflow: hidden;

                .text {
                    width: 120px;
                    margin: 0 0 0 4px;
                    position: absolute;
                }

                .mouse {
                    animation: textMouse 6s ease-in-out infinite alternate;
                }

                @keyframes textMouse {
                    0% {
                        transform: translateY(0);
                        opacity: 1;
                    }

                    46% {
                        transform: translateY(0);
                        opacity: 1;
                    }

                    54% {
                        transform: translateY(40px);
                        opacity: 0;
                    }

                    100% {
                        transform: translateY(40px);
                        opacity: 0;
                    }
                }

                .keyboard {
                    animation: textKeyboard 6s ease-in-out infinite alternate;
                }

                @keyframes textKeyboard {
                    0% {
                        transform: translateY(-40px);
                        opacity: 0;
                    }

                    46% {
                        transform: translateY(-40px);
                        opacity: 0;
                    }

                    54% {
                        transform: translateY(0);
                        opacity: 1;
                    }

                    100% {
                        transform: translateY(0);
                        opacity: 1;
                    }
                }

            }

        }

    }

    ////MUSIC BUTTON///
    .musicBtn {
        width: fit-content;
        height: 42px;
        padding: 12px;
        left: 15px;
        bottom: 1.8%;
        position: absolute;
        display: flex;
        justify-content: center;
        align-items: center;
        z-index: 10;
        height: fit-content;
        opacity: 0;
        pointer-events: none;

        @media screen and (max-width: 539px) {
            left: 2%;
            bottom: .8%;
            padding: 0;
            height: 30px;
        }

        .lineContainer {
            display: flex;
            justify-content: center;
            align-items: center;
            width: fit-content;
            height: fit-content;

            .soundMask {
                width: 56px;
                height: 21px;
                position: absolute;
                margin: 0 2px 2px 2px;
                background: $cyan;
                clip-path: inset(100% 0 0 0);
            }

            .line {
                width: 1px;
                background: $cyan;
                height: 18px;
                margin: 0 2px 0 2px;
                clip-path: inset(90% 0 0 0);
                z-index: -1;

                &.switch {
                    animation: soundLines .75s ease-in-out infinite alternate;
                }

                &.switch:nth-child(1) {
                    animation-delay: 0s
                }

                &.switch:nth-child(2) {
                    animation-delay: .7s
                }

                &.switch:nth-child(3) {
                    animation-delay: .2s
                }

                &.switch:nth-child(4) {
                    animation-delay: .5s
                }

                &.switch:nth-child(5) {
                    animation-delay: .9s
                }

                &.switch:nth-child(6) {
                    animation-delay: .1s
                }

                &.switch:nth-child(7) {
                    animation-delay: .6s
                }

                &.switch:nth-child(8) {
                    animation-delay: .3s
                }

                &.switch:nth-child(9) {
                    animation-delay: 1s
                }

                &.switch:nth-child(10) {
                    animation-delay: .4s
                }

                &.switch:nth-child(11) {
                    animation-delay: .6s
                }
            }

            @keyframes soundLines {
                0% {
                    clip-path: inset(90% 0 0 0);
                }

                100% {
                    clip-path: inset(0 0 0 0);
                }
            }
        }

        .containerIndication {
            width: 45px;
            height: 16px;
            position: relative;
            overflow: hidden;

            .on,
            .off {
                margin: 0 0 0 7px;
                font-family: 'littleTitle';
                letter-spacing: 2px;
                font-size: 13px;
                font-weight: 600;
                color: $cyan;
                position: absolute;
                transition: .75s cubic-bezier(.75, 0, 0, 1);

                @media screen and (max-width: 539px) {
                    font-size: 3vw;
                }
            }

            .on {
                text-shadow: 0px;
                transform: translateY(50px);
                animation: blink 4s infinite alternate;

                &.switch {
                    transform: translateY(0);
                }
            }

            .off {
                transform: translateY(0);

                &.switch {
                    transform: translateY(-50px);
                }
            }
        }
    }

    ////SOCIALS MEDIA///
    .sm {
        width: 42px;
        height: 42px;
        position: absolute;
        right: 18px;
        color: $cyan;
        display: flex;
        justify-content: center;
        align-items: center;
        z-index: 10;
        font-family: 'littleTitle';
        letter-spacing: 2px;
        font-size: 13px;
        overflow: hidden;
        font-weight: 600;

        @media screen and (max-width: 539px) {
            right: .8%;
            font-size: 3vw;
            width: 30px;
            height: 30px;
            letter-spacing: .2vw;
        }

        &.neonText {
            text-shadow: 0px;
            animation: blink 4s infinite alternate;
        }

        @keyframes blink {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $cyan, 0 0 2px $cyan, 0 0 2px $cyan;
            }

            32% {
                opacity: .25;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .25;
            }

            40% {
                opacity: 1;
            }
        }

        @keyframes blinkSound {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $cyan, 0 0 1px $cyan, 0 0 1px $cyan;
            }

            32% {
                opacity: .6;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .6;
            }

            40% {
                opacity: 1;
            }
        }

        @keyframes blinkBtn {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $bleu, 0 0 1px $bleu, 0 0 1px $bleu;
            }

            32% {
                opacity: .65;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .65;
            }

            40% {
                opacity: 1;
                text-shadow: 0 0 0 $bleu, 0 0 1px $bleu, 0 0 1px $bleu;
            }
        }

        @keyframes blinkSlogan {
            30% {
                opacity: 1;
                text-shadow: 0 0 0 $cyan, 0 0 1px $cyan, 0 0 1px $cyan;
            }

            32% {
                opacity: .65;
            }

            33% {
                opacity: 1;
            }

            35% {
                opacity: .65;
            }

            40% {
                opacity: 1;
                text-shadow: 0 0 0 $cyan, 0 0 1px $cyan, 0 0 1px $cyan;
            }
        }

        @keyframes inSM {
            to {
                transform: translateX(0);
            }
        }

        @keyframes outSM {
            to {
                transform: translateX(175%);
            }
        }

        @keyframes outImpairSM {
            to {
                transform: translateX(-175%);
            }
        }

        &__1 {
            bottom: 1.8%;
            opacity: 0;
            pointer-events: none;

            @media screen and (max-width: 539px) {
                bottom: .7%;
            }

            &.mouseover::after {
                content: "FB";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "FB";
                position: absolute;
                transform: translateX(-175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "FB";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(-175%);
            }

            &.mouseout::before {
                content: "FB";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }

        &__2 {
            bottom: 6.3%;
            opacity: 0;
            pointer-events: none;

            @media screen and (max-width: 539px) {
                bottom: .7%;
                right: 8%;
            }

            &.mouseover::after {
                content: "IG";
                position: absolute;
                animation: outImpairSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "IG";
                position: absolute;
                transform: translateX(175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "IG";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(175%);
            }

            &.mouseout::before {
                content: "IG";
                position: absolute;
                animation: outImpairSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }

        &__3 {
            bottom: 10.6%;
            opacity: 0;
            pointer-events: none;

            @media screen and (max-width: 539px) {
                bottom: .7%;
                right: 15.2%;
            }

            &.mouseover::after {
                content: "IN";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "IN";
                position: absolute;
                transform: translateX(-175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "IN";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(-175%);
            }

            &.mouseout::before {
                content: "IN";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }
    }

    .containerTimelineMobile {
        display: none;
        overflow: hidden !important;
