    @media screen and (max-width: 1024px) {

        .hamburgerContainer {
            position: fixed;
            width: 42px;
            height: 42px;
            position: absolute;
            right: 18px;
            z-index: 10;
            top: 1.5%;
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
            opacity: 0;
            pointer-events: none;

            @media screen and (max-width: 539px) {
                right: .8%;
                top: 0;
            }

            .line,
            .line2,
            .croix,
            .croix2 {
                width: 60%;
                background: $cyan;
                height: 1px;
                margin: 7%;
                transition: .3s cubic-bezier(.25, 0, 0, 1);
            }

            .line2 {
                transition-delay: .12s;
            }

            .line,
            .line2 {
                &.switch {
                    width: 0;
                }
            }

            .croix {
                transform: rotate(45deg);
                position: absolute;
                width: 0;
            }

            .croix2 {
                transform: rotate(-45deg);
                position: absolute;
                width: 0;
            }

            .croix,
            .croix2 {
                &.switch {
                    width: 60%;
                }
            }

            .croix2 {
                transition-delay: .12s;
            }
        }

        .containerTimelineMobile {
            position: absolute;
            width: 100%;
            height: 100vh;
            left: 0;
            top: 0;
            z-index: -1;
            display: flex;
            justify-content: center;
            align-items: center;
            background: $bleu;
            opacity: 0;
            transition: .75s cubic-bezier(.25, 0, 0, 1);

